import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div id="root"></div>

  );
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
 render(element, document.getElementById('root'));
}

export default App;
